    {
        text: "JPG"
    },
    {
        text: "PNG"
    },
    {
        text: "BMP"
    },
    {
        text: "SVG"
    }
];
const SAMPLE_CSS = `   .e-bigger #toolbar_diagram .e-icons.e-caret,
#toolbar_diagram .e-icons.e-caret {
    font-size: 12px;
    margin-right: 0px;
}

#custombtn {
    padding: 4px 0px 2px 4px;
}`;
export class PrintExport extends SampleBase {
    rendereComplete() {
        diagramInstance.fitToPage();
    }
    render() {
        function contentTemplate() {
            return (<DropDownButtonComponent items={items} iconCss="e-diagram-icons e-diagram-export" content="Export" select={onselect}>

      </DropDownButtonComponent>);
        }
        function checkboxTemplate() {
            return (<CheckBoxComponent id="checkBox" checked={false} ref={checkBox => (checkBoxObj = checkBox)} label="Multiple Page">

      </CheckBoxComponent>);
        }
        return (<div className="control-pane">
        <style>SAMPLE_CSS</style>
        <div className="control-section">
        <div className="content-wrapper" style={{ width: "100%" }}>
          
          <ToolbarComponent style={{ width: "100%", height: "10%", marginTop: "10px" }} id="toolbar_diagram" clicked={onItemClick}>
            <ItemsDirective>
              <ItemDirective type="Input" text="Export" template={contentTemplate}>

              </ItemDirective>
              <ItemDirective type={"Button"} text="Print" prefixIcon="e-diagram-icons e-diagram-print"/>
              <ItemDirective type={"Input"} template={checkboxTemplate}/>
            </ItemsDirective>
          </ToolbarComponent>
          
            <DiagramComponent id="diagram" ref={diagram => (diagramInstance = diagram)} width={"100%"} height={"580px"} nodes={nodes} connectors={connectors} snapSettings={{ constraints: SnapConstraints.None }} pageSettings={{ width: 550, height: 500, multiplePage: true }} getConnectorDefaults={(connector, diagram) => {
            connector.style.strokeColor = "#6d6d6d";
            return connector;
        }}>
              <Inject services={[PrintAndExport]}/>
            </DiagramComponent>
          </div>
        </div>
      </div>);
    }
}
function newFunction() {
    return "Export";
}
//click event to perform printing the diagraming objects.
function onItemClick(args) {
    let printOptions = {};
    switch (args.item.text) {
        case "Print":
            {
                printOptions.mode = "Data";
                printOptions.region = "PageSettings";
                printOptions.multiplePage = checkBoxObj.checked;
                printOptions.margin = { left: 0, top: 0, bottom: 0, right: 0 };
                diagramInstance.print(printOptions);
            }
            break;
    }
}
//Export the diagraming object based on the format.
function onselect(args) {
    let exportOptions = {};
    switch (args.item.text) {
        case "JPG":
            exportOptions.format = args.item.text;
            break;
        case "PNG":
            exportOptions.format = args.item.text;
            break;
        case "BMP":
            exportOptions.format = args.item.text;
            break;
        case "SVG":
            exportOptions.format = args.item.text;
            break;
    }
    exportOptions.mode = "Download";
    exportOptions.region = "PageSettings";
    exportOptions.multiplePage = checkBoxObj.checked;
    exportOptions.fileName = "Export";
    exportOptions.margin = { left: 0, top: 0, bottom: 0, right: 0 };
    diagramInstance.exportDiagram(exportOptions);
}

render(<PrintExport />, document.getElementById('sample'));

